import React from 'react';
import { Redirect } from "react-router-dom";

const ProtectedRoute = ({ element: Component, ...props }) => {
  return (
    props.loggedIn ? <Component {...props} /> : <Redirect to="/login" replace/>
)};

export default ProtectedRoute;
